UPDATE AD_TAB SET AD_CLIENT_ID=0,AD_ORG_ID=0,ISACTIVE='Y',CREATEDBY=0,UPDATEDBY=100,NAME='Payment Processor',DESCRIPTION='Processor for online payments',HELP='The Electronic Payments Tab is used to define the parameters for the processing of electronic payments. If no currency is defined, all currencies are accepted. If a minumum amount is defined (or not zero), the payment processor is only used if the payment amount is equal or higher than the minumum amount. <br> The class needs to implement org.compiere.model.PaymentProcessor ',AD_TABLE_ID=398,AD_WINDOW_ID=158,SEQNO=40,TABLEVEL=2,ISSINGLEROW='Y',ISINFOTAB='N',ISTRANSLATIONTAB='N',ISREADONLY='N',AD_COLUMN_ID=null,HASTREE='N',WHERECLAUSE=null,ORDERBYCLAUSE=null,COMMITWARNING=null,AD_PROCESS_ID=null,PROCESSING='N',AD_IMAGE_ID=null,IMPORTFIELDS=null,AD_COLUMNSORTORDER_ID=null,AD_COLUMNSORTYESNO_ID=null,ISSORTTAB='N',ENTITYTYPE='D',INCLUDED_TAB_ID=null,READONLYLOGIC=null,DISPLAYLOGIC=null,ISINSERTRECORD='Y',ISADVANCEDTAB='N' WHERE AD_TAB_ID=326;
UPDATE AD_TAB SET AD_CLIENT_ID=0,AD_ORG_ID=0,ISACTIVE='Y',CREATEDBY=0,UPDATEDBY=100,NAME='Payment',DESCRIPTION='Payment or Receipt',HELP='Enter payment or receipt for a Business Partner.  If it is for a single invoice it can be allocated directly to that invoice using this screen. You can also apply over/under payments:<br> You have an over-payment, if you received more money than due for a single invoice. Instead of writing the difference off (i.e. would be a gain), you can leave the amount unallocated and use it for later invoices or credit memos. Please note that the Amount is the payment amount, so you need to enter the over-payment as a negative amount.<br> You can also receive a partial payment (under-payment). If you decide not to write off the remaining invoice amount, enter the under-payment as a positive amount.<br> Note that printed payments are archived in Payment Selection (Prepared Payment). <br>For Posting, the bank account organization is used, if it is not a charge.',AD_TABLE_ID=335,AD_WINDOW_ID=195,SEQNO=10,TABLEVEL=0,ISSINGLEROW='Y',ISINFOTAB='N',ISTRANSLATIONTAB='N',ISREADONLY='N',AD_COLUMN_ID=null,HASTREE='N',WHERECLAUSE='C_Payment.TrxType<>''X''',ORDERBYCLAUSE=null,COMMITWARNING=null,AD_PROCESS_ID=313,PROCESSING='N',AD_IMAGE_ID=null,IMPORTFIELDS=null,AD_COLUMNSORTORDER_ID=null,AD_COLUMNSORTYESNO_ID=null,ISSORTTAB='N',ENTITYTYPE='D',INCLUDED_TAB_ID=null,READONLYLOGIC=null,DISPLAYLOGIC=null,ISINSERTRECORD='Y',ISADVANCEDTAB='N' WHERE AD_TAB_ID=330;
